import { Component, EventEmitter, OnDestroy, OnInit, Output } from '@angular/core';
import { DataService } from '../data.service';
import { Router } from '@angular/router';
import { AuthService } from '../auth.service';
import Swal from 'sweetalert2';
import { share } from 'rxjs';

@Component({
  selector: 'app-user-data',
  templateUrl: './user-data.component.html',
  styleUrls: ['./user-data.component.scss'],
})
export class UserDataComponent implements OnInit, OnDestroy {
  @Output() editData = new EventEmitter<Object>();
  sharedData: any;
  editMode = false;


  constructor(
    private dataService: DataService,
    private router: Router,
    private authService: AuthService
  ) {}

  ngOnInit() {
    this.dataService
      .fetchData(+localStorage.getItem('diplayIndex'))
      .subscribe((response: any) => {
        this.sharedData = response;
      });

  }
  ng

  onEdit(data: any) {
    this.dataService.editMode = true;
    this.dataService.editId = this.sharedData.id;
    this.router.navigate(['/editDetails/' + this.dataService.editId]);
  }

  getKeysWithTrueValues(obj: { [key: string]: boolean }): string[] {
    return Object.keys(obj).filter((key) => obj[key] === true);
  }

  onLogout() {
    this.authService.logout();
    const Toast = Swal.mixin({
      toast: true,
      position: 'top-end',
      showConfirmButton: false,
      timer: 1000,
      timerProgressBar: true,
      didOpen: (toast) => {
        toast.addEventListener('mouseenter', Swal.stopTimer);
        toast.addEventListener('mouseleave', Swal.resumeTimer);
      },
    });

    Toast.fire({
      icon: 'success',
      title: 'Loged Out',
    });
    this.router.navigate(['/login']);
  }
}
